import React from 'react';
import styles from '../styles/Projects.module.css';

const Projects = () => {
    return (
        <section className="section">
            <div className="container">
                <h2 className="section-title">Proyectos</h2>
                <div className={styles.container}>
                    <div className={styles.project}>
                        <h3>Sistema de Monitoreo de Signos Vitales</h3>
                        <p>Desarrollo de un dispositivo portátil para el monitoreo continuo de signos vitales en pacientes ambulatorios.</p>
                        <a href="#" className="project-link">Ver más detalles</a>
                    </div>
                    <div className={styles.project}>
                        <h3>Optimización de Flujo en Quirófanos</h3>
                        <p>Análisis y mejora de procesos en quirófanos para reducir tiempos de espera y mejorar la eficiencia operativa.</p>
                        <a href="#" className="project-link">Ver más detalles</a>
                    </div>
                    <div className={styles.project}>
                        <h3>Prótesis Inteligente de Miembro Superior</h3>
                        <p>Diseño de una prótesis de brazo con control mioelectrico y retroalimentación táctil.</p>
                        <a href="#" className="project-link">Ver más detalles</a>
                    </div>
                </div>
            </div>
        </section>
    );
};

export default Projects;
